import React from "react";
import ReactWeather from "react-open-weather";
import "react-open-weather/lib/css/ReactWeather.css";

export const Weather = () => {
  return (
    <div>
      <ReactWeather
        forecast="today"
        apikey="3674b65e6c4f839884c64ddd0c1258bb"
        type="city"
        city="Jakarta"
      />
    </div>
  );
};
